def extract_data(pdf_path, filename):

    ### 1. Получение из pdf файла таблицы и номера документа (1-я строчка сверху)
    with pdfplumber.open(pdf_path) as pdf:

        ### 1.1. Извлечение заголовка для получения номера документа ('ORD')
        page = pdf.pages[0]
        text = page.extract_text()
        docNumber = text[ 0 : text.find('\n') ].split(':')[-1]


        ### 1.2. Извлечение таблицы из каждой страницы и добавление в список для дальнейшего объединения
        all_tables = []
        for page in pdf.pages:
            tables = page.extract_tables()
            for table in tables:
                if filename[0]=='n':
                    if 'Информация об оборудовании или материале'in table[0][0] or 'Ishdan chiqqan, kamchilik aniqlangan uskuna yoki materialga'in table[0][0]:
                        table.pop(0)
                    all_tables.append( pd.DataFrame(table, columns=['№','Материал (из акта)','Данные материала', 'Количество (из акта)', 'Ед.изм', 'Примечание',
                                                                         'Материал (новый)','Данные материала (новый)','Количество (новый)','Ед.изм (новый)','Код товара']) )
                else:
                    all_tables.append( pd.DataFrame(table, columns=['№','Материал (из акта)','Код товара', 'Количество (из акта)', 'Ед.изм', 'Примечание']) )
    ### !!! Конструктор первоначального df из шаблона акта меняется здесь

        


    ### 2. Объединение dataFrames (таблиц из pdf) и добавление номера документа
    df = pd.concat(all_tables, ignore_index=True)
    df['Номер документа'] = docNumber
    df['Номер файла'] = filename


    ### Exception wrong template
    ### !!! Конструктор первоначального df из шаблона акта исключение
    if docNumber == 'ORD-048/492-2025':
        df = pd.DataFrame([
            {'№':1,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0054344','Материал (из акта)':'Size24 600','Количество (из акта)':1},
            {'№':2,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0076615','Материал (из акта)':'Gasket 1095/10','Количество (из акта)':1},
            {'№':3,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0076614','Материал (из акта)':'Gasket 1095/10','Количество (из акта)':1},
            {'№':4,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0070455','Материал (из акта)':'Gasket K3700','Количество (из акта)':1},
            {'№':5,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0002388','Материал (из акта)':'Паронит','Количество (из акта)':23.4},
            {'№':6,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0056579','Материал (из акта)':'Size 625*180','Количество (из акта)':4},
            {'№':7,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0056548','Материал (из акта)':'Size 625*200','Количество (из акта)':4},
            {'№':8,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0056547','Материал (из акта)':'Size 625*195','Количество (из акта)':4},
            {'№':9,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0056545','Материал (из акта)':'Size 625*170','Количество (из акта)':4},
            {'№':10,'Номер файла':filename,'Номер документа':docNumber,'Код товара':'WIM0068318','Материал (из акта)':'Stud Bolt','Количество (из акта)':6},
            ])
    

    ### 3. Форматирование данных
    df = df.loc[ df['№'] != "№" ]
    df['Материал (из акта)'] = df['Материал (из акта)'].apply(lambda x: x.replace('\n', ' ').replace('/n', ' '))
    df['Код товара'].fillna('undefined', inplace=True)
    df['Код товара'] = df['Код товара'].map(lambda x: x.strip()) # удаление пробелов и табуляции
    df['Количество (из акта)'] = pd.to_numeric(df['Количество (из акта)'], errors='coerce')
    df['Количество (из акта)'].fillna(0, inplace=True)

    return df[['№','Номер файла','Номер документа','Код товара','Материал (из акта)','Количество (из акта)']]

